import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import { Button, Col, Container, Row } from "react-bootstrap";

const Blogpage = () => {
  return (
    <>
      <Header />
      <Container>
        <Row>
            <Col>
                <Row>
                    <Col>
                        <h2>All Articles</h2>
                    </Col>
                    <Col>
                        <Button></Button>
                    </Col>
                </Row>
            </Col>
            <Col>
                <h2>Recent Posts</h2>

            </Col>
        </Row>
      </Container>
      <Footer />
    </>
  );
};

export default Blogpage;
